import React from "react";
import { useParams } from "react-router-dom";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";


const ObjectPage = () => {
  const { id } = useParams(); // Get the reimbursment ID from the URL
  // Fetch and display the details based on the ID here
  return <div>Details for Reimbursement ID: {id}</div>;
};

export default ObjectPage;
